var lStore=function(t){this.key=t,this.init()};lStore.prototype.getAll=function(){return JSON.parse(localStorage.getItem(this.key))},lStore.prototype.add=function(t){var e=this.getAll();e.push(t),this.writeLS(e)},lStore.prototype.clear=function(){localStorage.removeItem(this.key)},lStore.prototype.removeEntry=function(t){for(var e=this.getAll(),o=[],r=0;r<e.length;)t!==e[r].id&&o.push(e[r]),r++;this.writeLS(o)},lStore.prototype.writeLS=function(t){localStorage.setItem(this.key,JSON.stringify(t))},lStore.prototype.itemExists=function(t){for(var e=this.getAll(),o=0;o<e.length;){if(t===e[o].id)return!0;o++}return!1},lStore.prototype.getItem=function(t){for(var e=this.getAll(),o=0;o<e.length;){if(t===e[o].id)return e[o];o++}return!1},lStore.prototype.getNrOfItems=function(){return this.getAll().length},lStore.prototype.empty=function(){localStorage.setItem(this.key,JSON.stringify([]))},lStore.prototype.init=function(){window.hasOwnProperty("localStorage")?null===localStorage.getItem(this.key)&&this.empty():window.alert("Please considering upgrading browser to be able to use lStore Plugin")};